import React from "react";
import { Button, RadioGroup, FormControl, FormLabel } from "@mui/material";
import Radio, { radioClasses } from '@mui/joy/Radio';
export default function PageOne() {
  return (
    <FormControl>
      <FormLabel color="text">What is your goal?</FormLabel>
      <RadioGroup
        sx={{
          flexDirection: "row",
          gap: 2,
          [`& .${radioClasses.checked}`]: {
            [`& .${radioClasses.action}`]: {
              inset: -1,
              border: "3px solid",
              borderColor: "primary.500",
            },
          },
          [`& .${radioClasses.radio}`]: {
            display: "contents",
            "& > svg": {
              zIndex: 2,
              position: "absolute",
              top: "-8px",
              right: "-8px",
              bgcolor: "background.surface",
              borderRadius: "50%",
            },
          },
        }}
      ></RadioGroup>
    </FormControl>
  );
}
